import React from 'react';
import s from "./InfoPage.module.css"
import OneBook from "../../components/OneBook/OneBook";

const InfoPage = (props) => {
    return (
        <div className={s.info}>
            <div className={s.top}>
                <OneBook />
            </div>
        </div>
    );
};

export default InfoPage;
